package juan.jose;

import static org.hamcrest.core.Is.is;
import static org.junit.Assert.assertThat;

import org.junit.Before;
import org.junit.Test;

public class SoupOfTheDayTest {

    private SoupOfTheDay underTestV1;

    private SoupOfTheDay2 underTestV2;

    @Before
    public void setUp() {
        underTestV1 = new SoupOfTheDay();
        underTestV2 = new SoupOfTheDay2();
    }

    @Test
    public void shouldReturnFalseWhenMessageIsLongerThanLetters() {
        // Given
        String message = "My name is Jose";
        String letterss = "jmasi";

        // When
        boolean canCreateMessageV1 = underTestV1.canCreateTheString(message, letterss);
        boolean canCreateMessageV2 = underTestV2.canCreateTheString(message, letterss);


        // Then
        assertThat(canCreateMessageV1, is(false));
        assertThat(canCreateMessageV2, is(false));
    }

    @Test
    public void shouldBePossibleToCreateTheMessageWhenBothStringAreTheSame() {
        // Given
        String message = "";
        String letterss = "";
        // When
        boolean canCreateMessageV1 = underTestV1.canCreateTheString(message, letterss);
        boolean canCreateMessageV2 = underTestV2.canCreateTheString(message, letterss);

        // Then
        assertThat(canCreateMessageV1, is(true));
        assertThat(canCreateMessageV2, is(true));
    }

    @Test
    public void shouldNotBePossibleToCreateTheMessageWhenThereAreMissingLetters() {
        // Given
        String message = "He llo yo";
        String letterss = "hellryo";

        // When
        boolean canCreateMessageV1 = underTestV1.canCreateTheString(message, letterss);
        boolean canCreateMessageV2 = underTestV2.canCreateTheString(message, letterss);

        // Then
        assertThat(canCreateMessageV1, is(false));
        assertThat(canCreateMessageV2, is(false));
    }

    @Test
    public void shouldReturnTrueWhenFullMessageIsOnTheLetters() {
        // Given
        String message = "My name Is Jose";
        String letterss = "asaasjngjnhfvmniuhgsvmyasmadfjgregdsvoasseasldjasdnameisaskldjasd";

        // When
        boolean canCreateMessageV1 = underTestV1.canCreateTheString(message, letterss);
        boolean canCreateMessageV2 = underTestV2.canCreateTheString(message, letterss);


        // Then
        assertThat(canCreateMessageV1, is(true));
        assertThat(canCreateMessageV2, is(true));

    }
}